import React from 'react';

function Contacts() {
  return (
    <div>
      <h2>Contact Us</h2>
      <p>Contact details of the HR department.</p>
      <div style={{ width: '100%', height: '400px' }}>
        <iframe
          title="Google Maps"
          width="100%"
          height="100%"
          style={{ border: 0 }}
          loading="lazy"
          allowFullScreen
          src="https://www.google.com/maps/embed/v1/place?key=YOUR_API_KEY&q=university">
        </iframe>
      </div>
    </div>
  );
}

export default Contacts;
